import Vue from 'vue';            
import Router from 'vue-router';
import App from './App.vue'
import Event from './pages/Event.vue'
import EventId from './pages/events/123.vue'
Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {   

      path: '/event',             
      name:Event, 
      component:Event, 

    },

    {   

      path: '/',             
      name: App,  
      component:App 
    },
    {
      path: '/event/123',
      name: 'EventId',
      component: EventId
    }  
  ]
});
